    //method to read from the text file to populate the report gui
    private void doReport(String type) throws FileNotFoundException, IOException, ParseException {
        reset_panel();
        String[] days = {"Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"};
        boolean[] isAvail = {false, false, false, false, false, false, false}; //sets the variables to false at the start of the method
        //sets both jlabels back to empty 
        /*for (int i = 0; i < availability.length; i++) {
            availability[i].setText("");
        }
        for (int i = 0; i < availtime.length; i++) {
            availtime[i].setText("");
        }*/
        ArrayList<DoctorNode> doctors = getAllDoctorsOneDiscipline(type);
        //loops through the arraylist

        int count = 0;
        
        for(String day : days){
            int min_start = -1;
            int max_end = -1;
            FileReader fr = new FileReader("src/ProgrammingAssignment/Availability");
            BufferedReader br = new BufferedReader(fr);
            System.out.println("Day : " + day);
            for (DoctorNode doctor : doctors) {
            boolean end= false;
            System.out.println("Doctor : " + doctor);
                String line;
                String[] values;
                while ((line = br.readLine()) != null) {
                    
                    if (line.trim().equals(doctor.getName().trim())){
                        while ((line = br.readLine()) != null) {
                            values = line.split(" ");
                            if(!Arrays.asList(days).contains(values[0].trim())) {
                                end = true;
                                break;
                            }
                            System.out.println("line : " + line);
                            
                            if (values[0].trim().equals(day.trim())){
                                if(!values[1].trim().equals(values[2].trim())){
                                    isAvail[count] = true;
                                    String[] start = values[1].split(":");
                                    String time = start[0] + start[1];
                                    if (min_start == -1 ) {
                                        min_start = Integer.parseInt(time);
                                    } else {
                                        min_start = Math.min(min_start, Integer.parseInt(time));
                                    }
                                    String[] end_time = values[2].split(":");
                                    time = end_time[0] + end_time[1];
                                    if (max_end == -1 ) {
                                        max_end = Integer.parseInt(time);
                                    } else {
                                        max_end = Math.min(max_end, Integer.parseInt(time));
                                    }
                                    System.out.println("start : " + min_start + " end : " + max_end);
                                    availtime[count].setText("Available : " + min_start + " - " + max_end);
                                }
                            }
                        }
                    }
                    if (end) break;
                }
            }      
            for (JLabel l : availtime){
               l.setVisible(true);
            }
            count++;
            fr.close();
            br.close();
        }

    }

 
    public ArrayList getAllDoctorsOneDiscipline(String discipline) {

        ArrayList<DoctorNode> doctorsOneDis = new ArrayList<DoctorNode>();
        DoctorQueue allDoctors = ProgrammingAssignment.getDoctorQueue();

        DoctorNode temp;

        temp = allDoctors.end; //temp is equal to the end of the queue
        //try this while temp is not equal to null (queue is not empty
        while (temp != null) {
            if(temp.getMedicalDiscipline().equals(discipline)){
                
                doctorsOneDis.add(temp);
            }
            //temp is equal to temp.getNext doctor to get the next doctor to count
            temp = temp.getNext();
        }
        return doctorsOneDis;
        
    }
    
